import React from "react";
import SocialMediaIcons from "../socialmediaicons/socialmediaicons";
import "./header.scss";
function Header() {
  return (
    <div className="header">
      <div className="container">
        <div className="navbar">

            <div className="navbar-item">
              <p>home</p>
            </div>
            <div className="navbar-item">
              <p>about</p>
            </div>
            <div className="navbar-item">
              <p>archevs</p>
            </div>
            <div className="navbar-item">
              <p>contact me </p>

            <SocialMediaIcons />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Header;
